import React from "react";
import Button from "@material-ui/core/Button";
import ButtonGroup from "@material-ui/core/ButtonGroup";
import { makeStyles } from "@material-ui/core/styles";
import { NavLink } from "react-router-dom";
import { useNavigate } from "react-router-dom";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    "& > *": {
      margin: theme.spacing(1)
    },
    "overflow-x": "scroll",
    "min-width": "150px"

  },
  buttonGroup: {
    "min-width": "450px"
  }
}));

export default function MundialButtonGroup() {
  const classes = useStyles();
  let navigate = useNavigate();
  const Octavos = () => {
    let path = `/mundial/round`;
    navigate(path, { replace: true });
  };
  const Cuartos = () => {
    let path = `/mundial/round2`;
    navigate(path, { replace: true });
  };
  const Semis = () => {
    let path = `/mundial/round3`;
    navigate(path, { replace: true });
  };
  const ThirdPlace = () => {
    let path = `/mundial/round4`;
    navigate(path, { replace: true });
  };
  const Final = () => {
    let path = `/mundial/round5`;
    navigate(path, { replace: true });
  };
  return (
    <div className={classes.root}>
      <ButtonGroup className={classes.buttonGroup} color="primary" aria-label="outlined primary button group">
        <Button onClick={Octavos}>Octavos</Button>
        <Button onClick={Cuartos}>Cuartos</Button>
        <Button onClick={Semis}>Semis</Button>
        <Button onClick={ThirdPlace}>3ยบ puesto</Button>
        <Button onClick={Final}>Final</Button>
      </ButtonGroup>
    </div>)}
